                        start_Win: '\xa1Te deseamos la bienvenida a las Olimpiadas Internacionales de Coding! Esperamos que est\xe9s emocionado(a) para empezar esas aventuras de coding.\n\nLas Olimpiadas de Coding son una serie de desaf\xedos que te ayudar\xe1n a explorar el mundo de Python, uno de los idiomas de coding m\xe1s populares en el mundo. En cada nivel, vas a aprender a usar las herramientas de coding Python para resolver varios tipos de problemas.\n\n\xc9l es nuestro amigo, \xa1Dev el robot! A lo largo de las Olimpiadas de Coding, vas a escribir c\xf3digos que le ayudar\xe1n a Dev a colectar Energy y a viajar en el espacio. Cada nivel requiere que ingreses el c\xf3digo correcto en el \xe1rea de coding y que des clic en "RUN" para controlar los movimientos de Dev a trav\xe9s del espacio. \xa1En ciertos niveles, encontrar\xe1s tambi\xe9n Flyers y un Spaceship que ayudar\xe1n a Dev a alcanzar nuevas aventuras! \n\n\xa1Guarda en mente que hay normalmente m\xe1s de una manera de completar el desaf\xedo, as\xed que tendr\xe1s que usar tu creatividad!\n\n\xbfListo(a) para comenzar? \xa1Que empiece el viaje!',
