                        error_message_text6: "\u05d9\u05e9\u05e0\u05d4 \u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05e9\u05d5\u05e8\u05d4 XX \u05e9\u05dc \u05d4\u05e7\u05d5\u05d3\n\u05d9\u05d5\u05ea\u05e8 \u05de\u05d3\u05d9 \u05e6\u05e2\u05d3\u05d9\u05dd \u05e0\u05d3\u05e8\u05e9\u05d9\u05dd \u05db\u05d3\u05d9 \u05dc\u05d4\u05e8\u05d9\u05e5 \u05d0\u05ea \u05d4\u05ea\u05d5\u05db\u05e0\u05d4. \u05d9\u05db\u05d5\u05dc \u05dc\u05d4\u05d9\u05d5\u05ea \u05e9\u05d9\u05e9 \u05dc\u05d5\u05dc\u05d0\u05d4 \u05d0\u05d9\u05e0\u05e1\u05d5\u05e4\u05d9\u05ea.",
